const estilos = {
    borderColor: '#f00',
    borderWidth: '5px',
    borderStyle: 'solid',
    padding: '3rem',
    fontSize: '3rem'
};


function Container(){
    return (
            <div style={estilos}>
                 Hola mundo
            </div>
        );
}

export default Container;
